    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract meaningful data to verify task completion (e.g., check for the presence of profile elements)
    const profileHeader = await page.$('h1'); // Example: assuming there's an h1 element for the profile name
    const profileName = profileHeader ? await profileHeader.innerText() : null;

    return {
      success: true,
      action: "Navigated to the Profile page from the sidebar",
      extractedData: { profileName },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
